$bucket = $s3->create_bucket('my-bucket-logs', $s3::REGION_US_E1);

// Ensure that the bucket was created successfully...
if ($bucket->isOK())
{
    // Enable READ_ACP and WRITE permissions for the system-wide "logging" user.
    $acl = $s3->set_bucket_acl('my-bucket-logs', array(
        array( 'id' => $s3::USERS_LOGGING, 'permission' => $s3::GRANT_READ_ACP ), // Logging user, READ_ACP
        array( 'id' => $s3::USERS_LOGGING, 'permission' => $s3::GRANT_WRITE ), // Logging user, WRITE
        array( 'id' => AWS_CANONICAL_ID, 'permission' => $s3::GRANT_FULL_CONTROL ) // Self, FULL_CONTROL
    ));

    // Ensure that the ACL was set correctly...
    if ($acl->isOK())
    {
        // Enable logging on the bucket
        $response = $s3->enable_logging('my-bucket', 'my-bucket-logs', 'log_', array(
            'users' => array(
                array('id' => 'ryan@getcloudfusion.com', 'permission' => $s3::GRANT_FULL_CONTROL)
            )
        ));

    }
}

// Success?
var_dump($response->isOK());

